def solve():
    s = "t12 t3 t3 t14 t9 t15 t0 t6 t2 t0 t2 t14 t5"

    def is_valid_grammar(grammar, string):
        """
        Checks if the grammar can generate the given string.
        """
        try:
            # Parse the grammar
            grammar_dict = parse_grammar(grammar)

            # Parse the string
            string_dict = parse_string(string)

            # Validate the string
            if string_dict == string:
                return True
            else:
                return False
        except Exception as e:
            print(f"Error during grammar/string parsing: {e}")
            return False

    def parse_grammar(grammar):
        """
        Parses the grammar.
        """
        grammar_dict = {}
        for rule in grammar:
            if rule.startswith('S'):
                label = rule[len('S'):].strip()
                grammar_dict[label] = []
            elif rule.startswith('NT'):
                label = rule[len('NT'):].strip()
                grammar_dict[label].append(rule)
        return grammar_dict

    def parse_string(string):
        """
        Parses the string.
        """
        string_dict = {}
        tokens = string.split()
        for token in tokens:
            if token == 't':
                if token not in string_dict:
                    string_dict[token] = 1
                else:
                    string_dict[token] += 1
            else:
                if token not in string_dict:
                    string_dict[token] = 0
                string_dict[token] += 1
        return string_dict

    if is_valid_grammar(s, "t12 t3 t3 t14 t9 t15 t0 t6 t2 t0 t2 t14 t5"):
        print("Yes")
    else:
        print("No")

